LL,'','1．锅煲的菜料要新鲜、干净。2．成菜在色泽和造型上要美观悦目。','1、香菇、冬笋、皮肚切成片，下锅煮熟，用调料调味，起锅放入小砂煲中。\n2、火腿、胡萝卜、莴笋切成长片，焯水后整齐摆放在小砂煲中的菜肴上，烧热即食。');
