INSERT INTO `everydayrecommendinfo` VALUES ('12f8da95-bd23-4536-ae57-663616afc0d8','5142d787-bc28-11e6-928b-68f72891be95',1483200000,'3','推荐理由：用米糊摊成一张香脆的薄饼，包上辛香的土豆泥，然后蘸着椰子酸辣酱、泡菜、西红柿扁豆酱等佐料吃。 这是一种极好的早餐食品，为你提供整个上午的能量，而午餐时你可能还想再来上一份。',1483283903),('3b99cfb2-bc2a-11e6-928b-68f72891be95','5142d787-bc28-11e6-928b-68f72891be95',1481040000,'2','推荐理由：hao',1483108493),('3b99cfb2-bc2a-11e6-928b-68f72891be95','5142d787-bc28-11e6-928b-68f72891be95',1482508800,'4','数据库中address表 city字段是varchar(30)\n\n修改类型可以用（谨慎修改类型，可能会导致原有数据出错）\n\nmysql> alter table address modify column city char(30);\n\n修改长度可以用（修改长度，要保证不短与已有数据，以保证原有数据不出错）\n\nmysql> alter table address modify column city varchar(50); \n',1482546610),('3b99cfb2-bc2a-11e6-928b-68f72891be95','5142d787-bc28-11e6-928b-68f72891be95',1483286400,'6','推荐理由：用米糊摊成一张香脆的薄饼，包上辛香的土豆泥，然后蘸着椰子酸辣酱、泡菜、西红柿扁豆酱等佐料吃。 这是一种极好的早餐食品',1483291618);
